import { createUseStyles } from 'react-jss';

export const useStyles = createUseStyles({
  wrapper: {
    width: '800px',
    minHeight: '300px',
    margin: '20px auto',
    border: '1px solid red'
  },
  giveWrapper: {
    width: '50%'
  },
  getWrapper: {
    width: '50%'
  }
});
